import React, { Component } from 'react';
import NoteComponent from './NoteComponent'
import EditNoteComponent from './EditNoteComponent'

class NotesContainer extends Component {

  render() {
    return (
      <div>
          <div>
                 <NoteComponent/>
         </div>

         <div>
             <EditNoteComponent/>
        </div>
     </div>
    );
  }
}

export default NotesContainer;
